measurements.description:
Two hundred seventy-three superbly formed and feathered bicolor flowers and 82 buds on 30 upright inflorescences to 47cm long;
	plant exceptionally well-flowered, 122cm tall, 100cm wide, grown in a 25cm black plastic pot;
	sepals and petals deep purple-feathered surrounding dark fuchsia centrally;
	lip dark fuchsia-purple, white centrally; column purple, anther cap white; substance average; texture matte.
